      all.where((i) => i.hasLineVariant && i.hasSolidVariant).toList();

  /// Get icon by name
  static DSIconData? byName(String name) => _iconMap[name.toLowerCase()];

  static final Map<String, DSIconData> _iconMap = {
    for (final icon in all) icon.name.toLowerCase(): icon,
  };
