/// Icon category enumeration
enum DSIconCategory {
  generic,
  dezerv,
}

/// Icon stroke style enumeration
enum DSIconStroke {
  line,
  solid,
}

/// Icon size enumeration
enum DSIconSize {
  small(16),
  medium(20),
  defaultSize(24),
  large(32);

  const DSIconSize(this.size);
  final double size;
}

/// Data class representing an icon
class DSIconData {
  const DSIconData({
    required this.name,
    required this.category,
    required this.hasLineVariant,
    required this.hasSolidVariant,
  });

  final String name;
  final DSIconCategory category;
  final bool hasLineVariant;
  final bool hasSolidVariant;

  String assetPath({
    DSIconStroke stroke = DSIconStroke.line,
  }) {
    final strokeFolder = stroke == DSIconStroke.line ? 'line' : 'solid';
    return 'assets/icons/generic/$strokeFolder/$name.svg';
  }

  @override
  String toString() => 'DSIconData($name)';

  @override
  bool operator ==(Object other) =>
      identical(this, other) ||
      other is DSIconData && runtimeType == other.runtimeType && name == other.name;

  @override
  int get hashCode => name.hashCode;
}
